import logo from './logo.svg';
import './App.css';
import 'animate.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
            <h1 className="animate__animated animate__bounce">An animated element</h1>
        </div>
      </header>
    </div>
  );
}

export default App;
